     <p class=MsoNormal style='text-align:justify'><span style='font-size:14.0pt;
     line-height:107%;font-family:"Times New Roman",serif;mso-fareast-font-family:
     "Times New Roman";color:black;mso-fareast-language:ES-SV'>El síndrome del
     ovario poliquístico es una enfermedad en la que hay múltiples quistes en
     los ovarios, lo que causa que sean mayores que un ovario normal. Se
     produce debido a cambios hormonales en la mujer. Causa infertilidad en
     mujeres, y reduce la producción de ovarios.</span><o:p></o:p></p>
